(33865, 90137, 0, 1, '愛的大圈圈 - 愛耶穌創作詩歌', '基督徒詩歌:: 愛的大圈圈  , 愛耶穌創作詩歌網站於2009推出的作品，希望您會喜歡!', '2010-10-01 00:00:00', 2000, 0, 1, 4, '我渴了你拿水來給我喝, 當我肚子餓你拿東西給我嗑\r\n當我生病了,你到我家來看我, 傷心了你會給我安慰\r\n當我孤單了,你會給我做陪, 如果沒有愛, 我的生命會如何\r\nYou are my brother, You are my sister 耶穌的愛讓我們圍個大圈圈\r\nYou are my brother ,You are my sister 讓我們一起跳進愛的大圈圈\r\n你渴了我拿水來給你喝 當你肚子餓我拿東西給你嗑 當你生病了我到你家來看你\r\n傷心了我來給你安慰 當你孤單了我來給你做陪 如果沒有愛,我的生命會如何\r\n\r\n我懂了 我懂了\r\n我懂了 你愛我我也愛你 我們彼此愛來愛去\r\n沒有什麼東西 可以擋住我的關心\r\n我們彼此關心 從此就有了美好的關係 吃什麼喝什麼 其實沒有關係\r\n在耶穌基督裡 我們都是 姐妹兄弟 我們可以連在一起\r\n\r\n我懂了(my brother) 我懂了\r\n耶穌的愛讓我們圍個大圈圈\r\n我懂了(my sister) 我懂了\r\n讓我們一起跳進愛的大圈圈\r\n\r\n我懂了(my brother) 我懂了 耶穌的愛讓我們圍個大圈圈\r\n我懂了(my sister) 我懂了 讓我們一起跳進愛的大圈圈\r\nYou are my brother You are my sister 耶穌的愛讓我們圍個大圈圈\r\nYou are my brother You are my sister 讓我們一起跳進愛的大圈圈\r\nWait a minute 故事還沒 The end\r\n如果有一天 耶穌問我一個問題 還有很多人 都沒有在圈圈裡面 有沒有看見\r\n圈圈外面 有人生病  多少人 餓著肚皮  多少人 孤單流淚在傷心\r\n還有人 沒有聽過福音  我們不能假裝 通通沒有看見\r\n愛的圈圈 不能只在我家裡  愛的圈圈 不能只在你家裡\r\n愛的圈圈 不能只在教會裡  從高山到海洋它都可以超越\r\n愛的圈圈 它其實沒有界限  愛的圈圈 它其實不分國界 全世界 都應該在 圈圈裡面 我懂了\r\n我懂了 我懂了\r\n耶穌的愛讓我們圍個大圈圈\r\nYou are my brother, You are my sister\r\n把全世界都放進愛的大圈圈', '', 282, '', '張榮凱', '張榮凱', '張榮凱', '愛耶穌創作詩歌', '', 0, 1, 0, '2011-03-22 09:18:38', '2015-03-12 13:46:24', '0000-00-00 00:00:00'),
