(33877, 181, 0, 1, '越過2000 (千禧年) [ Millennium ]', '2000年作品\r\n簡介：越過2000 (千禧年) [ Millennium ] \r\n詳情：http://www.facebook.com/KSmusic#!/notes/kevin-su/millennium/10150131272359636\r\n\r\n在服役期間，每當我放假回家的時候我都會利用這些假期開始我的音樂創作…\r\n那時…很多人非常期待這2000年新21世紀的來臨！很幸運的是…\r\n服役期間剛好放第一批的新年期假！可以為這樣特別的年作一首曲子。\r\n因此我～1999年12月31號晚上開始動工\r\n別人在外頭跨年而我把自己關在家裡開始我的音樂創作…\r\n看著時鐘因應著1999年底時間馬上要越過2000的凌晨…\r\n我終於完成了這音樂作品『越過2000（千禧年）』\r\n聽到外面有一陣陣的煙火聲音！\r\n我很高興這是新21世紀第一首曲子，就在這2000（千禧年）誕生！', '2000-01-01 00:00:00', 2000, 20, 0, 3, '', '', 282, '', '蘇凱群', '', '蘇凱群', '凱斯音樂', '', 0, 1, 0, '2011-03-22 19:54:54', '2015-03-12 13:46:24', '0000-00-00 00:00:00'),
