(33895, 93804, 3321, 1, '不想悶著寒假卻又不想開學', '', '2011-02-26 00:00:00', 2000, 0, 2, 12, '一個月的寒假過的真的是很愜意～～\r\n我說開學本來不是上禮拜一，\r\n怎麼見到你還要等下禮拜一！？！？\r\n就跟你說過，反正逢首週，\r\n也就是每個PEOPLE所謂的選課週！\r\n「二月二十八」還要放假～\r\n不如就醬，三月到了再見大家！！！\r\n\r\n我還是丁繼 STINGIE 醬子古錐的 STINGIE JOHN，\r\nSTINGIE JOHN！ STINGIE JOHN！！\r\nLOVE U LOVE U LOVE U GUYS >///<\r\n\r\n不管什麼壓力掉下來都保持活力～\r\n或是石頭路途作梗也要活力～\r\n否極活力～ 泰來也活力～\r\n因為我從不受它們得感冒！！！\r\n\r\n很感恩寒假的每個人事務，\r\n讓我長大了卻不是變大怪物，\r\n因為我討厭世故，陳腔濫調太土！\r\n所以我說假大人們～ PA-QULIQULIDU (也卡差不多咧)！\r\n\r\n真正的大人是大在腦子裡\r\n哪是像你講的大在應酬裡，UI ANGATA (真的真的)！\r\n假假惺惺的樣子不適合我，\r\n所以我要把它還給 大～笨～蛋～\r\n\r\n我還是丁繼 STINGIE 醬子古錐的 STINGIE JOHN，\r\nSTINGIE JOHN！ STINGIE JOHN！！\r\nLOVE U LOVE U LOVE U GUYS >///<', '', 115, '', '江亦錀', '江亦錀', '江亦錀', '丁繼音樂', '', 0, 0, 1, '2011-03-24 07:27:39', '2013-10-07 17:18:18', '0000-00-00 00:00:00'),
(33896, 93804, 3277, 1, '快樂．不難 (Feat. MCY)', '', '2010-10-22 00:00:00', 2010, 0, 2, 2, '[MCY]\r\n天空灰濛濛 是一大片烏雲 讓你快速收拾起你快樂表情\r\n不知不覺 開始煩惱東煩惱西 快樂的心情 也跟著盪到谷底\r\n在谷底徘徊 這感覺也說不上來 只是覺得有什麼在你心裡作怪\r\n對人不理不睬 做事也無精打采 連微笑 也開始變的有些困難\r\n笑容從你的臉上 慢慢消失不見 越來越沉重的是你美麗雙眼\r\n這一切的一切 你不想被人發現 可是我們不會裝作視而不見\r\n\r\n[STINGIE]\r\n不要低著頭 麻煩抬起來 當你不開心 我們都在\r\n只要有微笑 每天都可以過的精采\r\n所有的煩惱 就這樣和他說 BYEBYE\r\nOH WOAH OAH OAH OALE OALE OHOH\r\n就這樣和他說 BYEBYE\r\n\r\n[MCY]\r\n一個人 雖然會孤單覺得寂寞 也會胡思亂想 讓自己覺得難受\r\n可以試著訴說 說出來我們都懂 快樂和難過其實都是自己在掌控\r\n掌控的是你嘴角微笑的弧度 發自內心的笑容也會感覺舒服\r\n踩著輕快的腳步 我們開心的跳舞 快樂對你來說 不是不可能的任務\r\n也知道馬上要開心有些困難 但要記得有我們在身邊陪伴\r\n不能無精打采 把重心放在未來 一個微笑可以讓每天過的精采\r\n\r\n[STINGIE]\r\n\r\n[MCY]\r\n說BYEBYE BYEBYE感冒頭痛不會來 雖然是句廣告台詞但卻是如此真實\r\n一個燦爛的微笑 能把病痛都擊倒 再困難的事情 也變的簡單明瞭\r\n覺得悶的時候 我們看看天空 會發現沒有烏雲 原來是這麼遼闊\r\n下過雨之後 看的到彩虹 到了夜晚星星會掛在天空閃爍\r\n一閃一閃 照亮你的心情 似乎提醒我們 不能停在原地\r\n記得無時無刻 把嘴角揚起 笑容會和你 變成最完美比例\r\n\r\n[STINGIE]', '', 240, '', '黃智筠', '黃智筠', '江亦錀', '丁繼音樂', '', 0, 0, 1, '2011-03-24 10:27:13', '2013-10-07 17:18:18', '0000-00-00 00:00:00'),
