(33910, 27238, 3279, 3, '未来原始 Future Primitive', '', '2014-10-10 00:00:00', 2000, 20, 2, 1, '', '生命的脆弱 命运的掌控 \n前路多坎坷 日子这么过\n心中的血汗 感动的眼泪 \n应该这么说 未来这么办\n你我本来就是一样 \n有设么不同 奇怪在那 \n为何排斥 内心呐喊 \n对我来说 \n就是一样 \n有设么不一样\n你到底有没有听到 \n心在发火 \n心在呐喊 \n这一切结束时 \n不要问我这么办\n为何你现在还是 \n自以为是 执谜不悔 \n这一切结束时 \nWhat you saying GO TO HELL\nFuture Primitive FIGHT FOR YOUR FUTURE \n始终听不到答案 变成感叹号 \n留下了遗憾 \nWHY WHY WHY WHY \n还是没出现', 352, '', '', '', '', '', '', 0, 1, 0, '2011-03-24 15:06:27', '2015-03-12 13:46:25', '0000-00-00 00:00:00'),
(33911, 27238, 3279, 2, '活 Gore', '', '2014-10-10 00:00:00', 2000, 20, 2, 1, '', '活是一种痛苦，每天等着失望来临。 \n就像失去方向，每天带着面具生活。\n心正流着鲜血，痛苦无奈痛苦悲伤 \n心正流着鲜血，快来带我到那个地方\n恶魔它带我离开这地方，到遥远的世界 \n在这一刹那我放下这一切，灵魂我交给它\nGore 这刹那别在压抑，别在压抑 让它爆发 \nGore 就让它在此爆发，别在压抑 让它走出来 \nGore 就让它在此爆灭，Let Out Your Anger! Let It Flow\n\nGore Gore Gore Gore', 292, '', '', '', '', '', '', 0, 1, 0, '2011-03-24 15:09:17', '2015-03-12 13:46:25', '0000-00-00 00:00:00'),
(33912, 27238, 3279, 4, '人口贩卖 Human Trafficking', '', '2014-10-10 00:00:00', 2000, 20, 2, 1, '我慢慢张开眼睛 发现到处变得不平静 \n我想要大声的呐喊 却发现我一动也不能动 \n\n后悔当初做出的约定 就是越来越不是那麽的清醒 \n想要说 但说不出口 \n\n你在我这里这样 疯狂大叫 \n你在我这里这样 无法停止的胡闹 \n你在我这里这样 精神错乱的一秒 \n你在我这里这样 没有诠注的姓 (控制不了的心跳) \n\n堕落的你 在野逃不过你我的烟景 \n\n你在我背后的言语 对我来说已经没有什么的关系 \n不想要那麽多猜疑 发却我一点也不介意 \n\n断了脚步 迷迷糊糊 不应该是 从头开始 浪费时间 得过却过 真的不应该 \n这种开始 没有却对 是惑不是 你来决定不想再说 由你来决定', '', 253, '', '', '', '', '', '', 0, 1, 0, '2011-03-24 15:11:41', '2015-03-12 13:46:25', '0000-00-00 00:00:00'),
