(33915, 88046, 0, 1, '在黑暗中跳舞_DEMO', '"版權所有 存活勢力樂團所有 翻版必究"', '2011-03-24 00:00:00', 2000, 0, 1, 4, '我看不見 我摸不著 循規蹈矩 黑 暗 中 握緊拳頭 仰頭怒 吼\r\n\r\n誰把燈關了 誰把我眼睛闔上了我 四周圍怎麼一點聲響都沒了 聽 連針掉到地上都聽到了\r\n心跳聲怎麼那麼大 伸手抓住胸口衣襟 怎麼摸也摸不著 原本屬於 生 命 的 地 方\r\n⋯⋯戰爭之後 可以換來和平 那和平是戰爭的藉口 還是和平唯一方式唯獨 戰爭 殺戮\r\n多少雙惶恐的眼睛 衣衫不整的小孩 眼神裡透露著不解 懷疑 佈滿血絲的顫抖\r\n有的來不及出生就已經離開人間 在戰爭之後是重整 是重生 卻也有可能只是\r\n目睹了 自私 邪惡 種下因果 扭曲了思想 是活著的 造就了 無解的 恨\r\n還是 上一代的槍 還沒停止擊發 我們不要讓你們在我們身上填上子彈 繼續擊發\r\n\r\n*\r\n在黑 暗 中 開始跳 舞 倒數吧 希望的響鐘\r\n只要 抓緊 一絲絲 的 重生機會 光芒就 在不遠前\r\n\r\n我看不見 我摸不著 黑 暗 中 握緊拳頭 仰頭怒 吼\r\n\r\n誰在哭 誰在呼 誰聽到我內心裡即將失去的希望 門外是誰在走動 是你嗎 可以幫我開門嗎\r\n呼吸聲愈來越大 汗水濕透我的衣裳 怎麼動也動不了 原本屬於 活 著 的 方 式\r\n太多的暴力壓迫著這個社會 太多假象覆蓋著真實傷疤 輕薄的假象底下 依舊膛血 斷裂\r\n你可以繼續咒罵電視裡天殺的人種繼續危害社會 你卻不敢打開隔壁哀嚎的淒慘呼救\r\n這種痛 深知入骨 道貌岸然的虛偽遠比戰爭 殺戮 還要令人不齒 你懂 我也懂 但是 誰會做\r\n子彈是裝到槍中扣下板機擊發死的是 無辜生命 暴力欺騙對惡視而不見是放縱\r\n是比子彈還要更深更深的傷害 害慘了一代代子孫 不該讓上一代黑暗 延續下去\r\n\r\n*\r\n人與人之間是份連結 用愛作為媒介 微笑是共通的語言\r\n伸出援手是必然的因果 我們都懂 你絕對懂 可是 沒有可是 噓 沒有藉口\r\n\r\n在黑暗中跳舞 為了等待希望到來\r\n磨練是為了迎接光芒 考驗 歷練 是人生的教練\r\n獨自翩翩起舞 代表我不同流合汙\r\n在黑暗中 噓 看著我狼目銳利燦放光芒\r\n\r\n黑暗中 跳舞吧 微笑著 希望', '', 243, '', '存活勢力', '存活勢力', '存活勢力', '', '', 1, 1, 0, '2011-03-24 16:37:24', '2015-03-12 13:46:25', '0000-00-00 00:00:00'),
(33916, 93309, 0, 1, '南方(Demo)', '【陳岢鋐Facebook粉絲專頁 http://www.facebook.com/kemusic】\r\n\r\n19年,高雄 我的家鄉。', '2011-03-24 00:00:00', 2011, 0, 2, 1, '南方\r\n\r\n詞/曲 陳岢鋐\r\n編曲 黃浩軒\r\n\r\n整片金色的光 眷顧耕耘的人\r\n哪怕汗 濕了背 前方的路不平坦\r\n\r\n微笑倚靠港灣 暫忘人情冷暖\r\n如果走得太遠 別忘了回過頭看\r\n\r\n遙望南方　我的家鄉　\r\n抱著期盼　走向遠方\r\n\r\n抬頭張望　我的家鄉　\r\n有你揚帆　等我回航', '', 208, '', '陳岢鋐', '陳岢鋐', '', '', '', 0, 0, 0, '2011-03-24 19:29:24', '2015-03-12 13:46:25', '0000-00-00 00:00:00'),
(33917, 3615, 0, 1, '走過風雨', '這首歌曲的所得，將全數捐給紅十字會日本震災專戶，\r\n希望大家一起提供微薄的力量，自由樂捐，協助災民早日重建家園！\r\n\r\n（帳號：華南銀行和平分行121-20-0703686\r\n　戶名：中華民國紅十字會總會）\r\n\r\n----\r\n\r\n詳細歌曲介紹請參照：http://www.youtube.com/watch?v=V0eJ9XBDukQ\r\n或是：http://tw.beta.streetvoice.com/music/chrisxxx/song/137772/', '2011-03-24 00:00:00', 2000, 0, 2, 7, '( 中日文版歌詞請參照：http://www.youtube.com/watch?v=V0eJ9XBDukQ )\r\n\r\n走過風雨\r\n詞曲／製作／演唱：廖文強\r\n\r\n我曾以為在這世界上　自私是唯一信仰\r\n在你們身上　我卻看到了希望\r\n我曾以為只要不互相傷害　就能夠平安\r\n現在才發現　要互相扶持　才能走出難關\r\n\r\n或許我們能夠做的並不多\r\n但請別放棄為你所愛的人守候\r\n\r\n微笑是最堅強的力量\r\n帶領我們走出悲傷\r\n感謝這世界　是如此狹小\r\n好讓我們能夠緊緊擁抱\r\n\r\n希望是最堅固的城堡\r\n在遠方等著我們走到\r\n或許很煎熬　或許會受傷\r\n但走過風雨之後　會築起更堅固的家\r\n	\r\n即使你沒有能力改變些什麼\r\n也別忘了祈禱　讓這世界更好', '', 263, '', '廖文強', '廖文強', '廖文強', '', '', 1, 0, 0, '2011-03-24 21:06:33', '2015-03-12 13:46:25', '0000-00-00 00:00:00'),
