(33919, 60018, 0, 1, 'F.J-還不夠_ft.Dten', '這是一首感情歌\r\n男女生在曖昧時候可以聽的歌\r\n友達以上戀人未滿\r\n還不夠\r\n你可以送給你的姐妹\r\n妳可以送給妳的兄弟\r\nT.P.K 你現在聽到的\r\nF.J 還不夠 曖昧一波配上Dten 抒情的副歌 \r\n2011 最新作品!\r\n希望大家能夠喜歡,支持! 謝謝\r\n', '2011-03-25 00:00:00', 2000, 20, 0, 2, '還不夠 歌詞\r\n\r\n1.\r\n當她說想我的話~我只能放在心中\r\n她曾開口說 過她只想這樣靜靜的抱著我\r\n但她想  愛我 愛我\r\n能不能別說   她想 太多 太多\r\n但我聽她接著說\r\n\r\n我想說認識她的時候是在什麼時候\r\n我忘了  我們是在什麼哪個地方相遇 \r\ni don''t care  but you know 我們的關係\r\n有時忽近又疏離   有時又曖昧又鬥嘴\r\n說妳不可能會喜歡上我\r\n我其實真的沒有想的太多\r\n但妳也知道我之間的距離走到這裡就好\r\n還不夠 還不夠 這感覺不在相同\r\n我們都  別說把話放在感覺很多\r\n的那一秒鐘\r\n\r\n**\r\n別說妳愛我\r\n( 我想要說的 妳想要說的)\r\n別說妳想我\r\n( 喔我也愛妳    但不是那種感情 )\r\n有太多聊不完的話題  那太過傷人的旋律\r\n沒想過的感情  無法延續\r\n最安全的距離妳我關係 ( 妳也不要太多了吧)\r\n\r\n2.\r\n她曾經對我說她 這 輩 子 都不可能 愛 上 我\r\n但是  她想說心裡話 是真的嗎\r\n有時我們只不過是單純喝茶聊天\r\n她說她  好  想  我 但  是   又不是那個意思.....\r\n\r\n每當喝醉總是陪在我的身邊\r\n一個人的節日總和我一起 不曾抱怨\r\n但卻  少了情人的稱謂 多了曖昧的感覺\r\n暗示總裝聽不見我不想失去這關係  抱歉\r\n\r\n問我會不會擔心 哪天離開我\r\n進一步的關係問我有沒有想過\r\n問幾次都不說  我們彼此都懂\r\n我們都不希望聽見最後我說 \r\n\r\n**\r\n別說妳愛我\r\n( 我想要說的 妳想要說的)\r\n別說妳想我\r\n( 喔我也愛妳    但不是那種感情 )\r\n有太多聊不完的話題  那太過傷人的旋律\r\n沒想過的感情  無法延續\r\n最安全的距離妳我關係 ( 妳也不要太多了吧)\r\n\r\n當她說想我的話~我只能放在心中\r\n她曾開口說 過她只想這樣靜靜的抱著我\r\n但她想  愛我 愛我\r\n能不能別說   她想 太多 太多\r\n但我聽她接著說', '', 189, '', 'F.J / D.ten', 'F.J / D.ten', 'F.J', 'T.P.K', '', 0, 0, 1, '2011-03-25 04:02:36', '2013-10-07 17:18:19', '0000-00-00 00:00:00'),
