(33921, 60018, 0, 1, 'F.J-T.P.K_ft.Eason', 'T.P.K  團長 F.J  描述 T.P.K\r\n找來旗下Young Fresh 團體-SHOPPER BOYZ-Eason 跨刀\r\n充滿力量,台中態度風格的一首最新作品!\r\n\r\n還有多少朋友他不知道 T.P.K !!\r\n你現在聽到的!!\r\n希望大家會喜歡,支持!\r\n這首歌將收錄 F.J 即將發行個人首張 MIXTAPE!\r\n[That''s My Name]', '2011-03-25 00:00:00', 2000, 20, 0, 2, 'F.J [That''s My Name]-T.PK_ft.Easn\r\n\r\n**\r\n還有多少朋友他不知道 T.P.K ?\r\nAre you kidding me? 你不知道我是誰?\r\n我 logo不是抄襲洋基!! 你卡到陰嗎?\r\n你聽到我的聲音  你眼睛紅了嗎? \r\n\r\n1.\r\n看著多少的粉絲他們加入專 頁\r\n他們都想知道關於我的 一切\r\n不知道我的背後還有多少的團隊\r\n如果你是蝦哥~~~請你快點閃邊\r\n他 們都說TPK 的歌不夠商業\r\n誰管你實力在哪反正運氣比較專業\r\n想要 hustle 我的flow 說會支持的現在在哪裡\r\n阿?我看不見~~\r\n我自己發mixtape 沒有唱片公司簽約\r\n有好多小朋友他們都想要出唱片\r\n現在不發專輯 恩亨?\r\n是因為現在大家都不想要花錢買cd\r\n網路上就可以聽了不要裝笑為~\r\n只要你來看我表演 我CD不用錢~\r\nI''m young fresh check that''s all my dream\r\n如果你聽了超不爽拜託你快點攻擊\r\n**\r\n還有多少朋友他不知道 T.P.K ?\r\nAre you kidding me? 你不知道我是誰?\r\n我 logo不是抄襲洋基!! 你卡到陰嗎?\r\n你聽到我的聲音  你眼睛紅了嗎? \r\n\r\n2. Eason\r\nMY BOSS FJ 注意 U CAN SEE THAT\r\n你說你聽過他的作品拜託你只聽過一點點\r\n從台中街頭玩命到 I''M SO FRESH 你現在聽到的 \r\n全部都是他的SHIT 不用在多做介紹TOP WALK你知道\r\nLIKE ALL STAR TEAM  HATER CANT STOP IT BITCHS \r\n還在注意是   誰的FLOW最 亮眼\r\n是誰  LIKE YOUNG MONEY 我最值錢 哈哈\r\n在記清楚我的韻腳 我的花招  i am so phat 有多囂張\r\n你不用知道 桌上擺滿了香檳是因為我們像是vip\r\n你感到擔心是因為我們都太銳利 \r\n我的歌詞 我的押韻 我的團體 我們站在這裡\r\nWE ARE THE t.p.k 不會  再提醒你\r\nWE SO DOPE MAN   WE SO FLY MAN YEAH\r\n站在這裡除了我們還有誰\r\n\r\n**\r\n還有多少朋友他不知道 T.P.K ?\r\nAre you kidding me? 你不知道我是誰?\r\n我 logo不是抄襲洋基!! 你卡到陰嗎?\r\n你聽到我的聲音  你眼睛紅了嗎? \r\n3.\r\n你需要保持低調態度保持中立 \r\nwe from da block house\r\n多少人在背後妒忌 i starting on da top. \r\nkeep walk you know what it this \r\n他們都知道 for hiphop I do it like this \r\n我的靈感 它們這樣出現 當我開始下筆像像是好球\r\n我從不漏接 哈  you know my name F.J\r\nYA that''s my name 我們就叫做 T.P.K \r\n其他人respect你看我live 現場\r\n你需要尖叫 now push your mother fucker hands up\r\nanything i do you hear i make hot shit  now\r\nwe coming do da best 他們 talking  about me \r\n所以他們開始  starting 想要買我cd\r\n我就像   是underground star 我不像他們好傻 \r\n為了成功付出代價  I can''t stop 所以  \r\n我蓄勢待發\r\n\r\n**\r\n還有多少朋友他不知道 T.P.K ?\r\nAre you kidding me? 你不知道我是誰?\r\n我 logo不是抄襲洋基!! 你卡到陰嗎?\r\n你聽到我的聲音  你眼睛紅了嗎? ', '', 314, '', 'F.J / Eason', 'F.J / Eason', 'F.J ', 'T.P.K', '', 0, 1, 0, '2011-03-25 05:04:26', '2015-03-12 13:46:25', '0000-00-00 00:00:00'),
