(33927, 98571, 3286, 3, '壹章之二，諷。', '', '2011-03-18 00:00:00', 2000, 0, 2, 7, '如果人心可以揣測\r\n可以將自己困在陰暗的角落\r\n如果人眼可以看清\r\n可以將自已鎖在漆黑的地下\r\n可以為自己造一道牢固的牆  \r\n\r\n不必再看見聽聞無法阻止的邪惡\r\n不必再碰觸想像沒有盡頭的哀傷\r\n\r\n\r\n哭吧  哭吧　總有一天　丟棄依附的懼怕\r\n笑吧  笑吧　總有一天　擺脫糾纏的懦弱 \r\n受傷了　誰可以看見\r\n\r\n如果人心可以揣測\r\n可以為自己決定付出的多寡\r\n如果人眼可以看清\r\n可以為自己決定坦誠的質量\r\n可以為自己建一座防禦的城\r\n\r\n不必將瘡痂　血淋淋揭開在空氣中\r\n不必將傷口　赤裸裸攤平在陽光下\r\n\r\n哭吧　總有一天　擁有足夠的堅強\r\n笑吧　總有一天　獲取抗衡的氣量\r\n\r\n\r\n\r\n哭吧　總有一天　丟棄依附的懼怕\r\n笑吧　總有一天　擺脫糾纏的懦弱\r\n\r\n哭吧　總有一天　擁有足夠的堅強\r\n笑吧　總有一天　獲取抗衡的氣量\r\n世界上　誰不曾受傷\r\n', '', 250, '', '王存敬', 'Beautiful', '王存敬', '獨立製作', '', 0, 0, 1, '2011-03-26 05:49:58', '2013-10-07 17:18:19', '0000-00-00 00:00:00'),
