(33942, 93309, 0, 1, '在', '我在哪裡　?', '2011-03-27 00:00:00', 2000, 0, 2, 4, '在水裡呼吸　在空中嘆息\r\n在心裡祈禱　在夜晚著迷\r\n\r\n在手裡握緊　在眼中微醺\r\n在愛裡勇敢　在意識前進\r\n\r\n在夢裡追尋　在雨中忘記\r\n在懷裡安息　在壁畫妒忌\r\n\r\n在洞裡沉靜　在紙上談情\r\n在字裡堅定　在音符暫停\r\n\r\n我在哪裡　\r\n我在哪裡\r\n\r\n我和我的意識　在　進行\r\n我和我的偏激　在　持續\r\n我和我的純真　在　拉鋸\r\n\r\n我在哪裡　\r\n我在哪裡\r\n', '', 247, '', '陳岢鋐', '陳岢鋐', '', '', '', 0, 0, 1, '2011-03-27 02:20:06', '2013-10-07 17:18:19', '0000-00-00 00:00:00'),
(33943, 2724, 0, 1, '外星人來了 卡拉ok!', '在家一起唱!', '2011-03-27 00:00:00', 2000, 82, 0, 7, '**\r\n有一天我看到外星人  問我地球怎麼那麼熱\r\n有一天我看到外星人  他們拿著樂器再唱歌\r\n\r\n**\r\n那天我看見天空有燈  他的形狀好像圓圓的\r\n看起來好像酒後駕車  竟然掉下來撞壞我家大門\r\n然後裡面走出三個人  他們長的像鹹蛋超人\r\n心電感應說我是帥哥  我馬上就嚇昏\r\n\r\n想想昏掉其實不值得  應該裝熟一下我真笨\r\n醒來一看發現不見了  沒辦法只好到飛碟裡等\r\n沒想到飛碟裡這麼冷  而且空間大的嚇死人\r\n隨便按個鈕看what happen  喇叭竟然放出我最愛的布林克\r\n\r\n弟一天看到外星人  問地球怎麼那麼熱\r\n第二天看到外星人  說氧氣好像太多了\r\n第三天看到外星人  他們拿著樂器唱歌\r\n第四天看到外星人  他們再闖紅燈\r\n\r\n有一天我看到地球人 問他地球怎麼那麼熱\r\n有一天我看到地球人 他們拿著樂器在唱歌\r\n\r\n有一天我看到地球人 他們說我長像鹹蛋超人\r\n有一天我看到地球人 他們也聽我愛的布林克\r\n有一天我看到地球人 他們的氧氣讓我們休克\r\n有一天我看到地球人 他們看到綠燈 竟然會踩油門\r\n\r\n喔喔 我是外星人 喔喔 還是地球人 \r\n爸爸 他是龜仙人 我是賽亞人 所以是地球人\r\n\r\n喔喔 我是外星人 喔喔 還是地球人\r\n咦he! 麥可傑克森 托夢告訴我 其實我是月球人\r\n', '', 222, '', '帥哥閃', '帥哥閃', '帥哥閃', '', '', 1, 1, 1, '2011-03-27 02:20:54', '2013-10-07 17:18:19', '2013-09-25 15:51:28'),
